import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the cart element using its class and text content
    // The regex /Cart/ makes it flexible for "0 Cart", "1 Cart", etc.
    const cartButton = page.locator('div.cart:has-text(/Cart/)');
    await cartButton.waitFor({ state: 'visible', timeout: 5000 });
    await cartButton.click();

    // Wait for the cart modal to become visible
    // The JS sets display: block on the modal element
    const cartModal = page.locator('.modal[style*="display: block"]');
    await cartModal.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract text from the modal to verify it's open and showing the correct content
    const modalContent = cartModal.locator('.empty-cart');
    const extractedText = await modalContent.textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        modalText: extractedText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        console.error('Failed to take error screenshot:', e);
    }

    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
